import Modal from 'react-bootstrap/Modal';
import React, { useState, useEffect } from "react";
import ReactDOM from "react-dom";
import Button from 'react-bootstrap/Button';
import {MDBBtn} from 'mdbreact';
import { MDBContainer, MDBRow, MDBCol, MDBTable, MDBTableHead, MDBTableBody } from "mdbreact";

import GetService from '../components/apis/get.service';

function Display(objectID) {




    //const resp = GetService.getInfoDetails(objectID.value);
    //console.log(resp);
    var resp="";
    var title="tessssssssssss";

    const [show, setShow] = useState(false); //first state fur variable show
    const [loading, setLoading] = useState(false);
    const [details, setDetails] = useState("");

    const handleClose = () => setShow(false);
    /*
    const handleShow = () => {

      console.log(objectID);
      GetService.getInfoDetails(objectID.value).then((details)=>{
        resp=details;
      });
      console.log("Response Details aus GETSERVICE");
      console.log(resp);
      console.log(mResp);
      //title = resp.mycoreoject.metadata[0]["def.title"][0].title[0]["_"] 
      console.log(title);

      setShow(true);
    };
    */

    useEffect(() => {
      //setLoading(true);
      GetService.getInfoDetails(objectID.value).then((res)=>{
        console.log("Test");
        console.log(res);
        setDetails(res);
          //res.metadata[0]["def.title"][0].title[0]["_"]);
        //console.log(res.metadata);
      });
      //setLoading(false);
    }, []);



    return (
      <>

        <MDBBtn className="btn-anzeige" class="btn btn-success" onClick={()=>setShow(true)}>
          Anzeige
        </MDBBtn>
        {/*POP UP Fenster wird geöffet*/}
        <Modal
          size="lg"
          show={show}
          onHide={() => setShow(false)}
          aria-labelledby="example-modal-sizes-title-lg"
          centered
        >
          <Modal.Header closeButton>
            <Modal.Title id="example-modal-sizes-title-lg">
              {details}
            </Modal.Title>
          </Modal.Header>
          <Modal.Body>

          <MDBContainer>
            <MDBRow>
              <MDBCol md="5">
                <div>
                      <p>a</p>
                      <p>a</p>
                      <p>a</p>
                    </div>
                    <div>
                      <p>b</p>
                      <p>b</p>
                      <p>b</p>
                    </div>
                  {/*this.state.details.map((item, index) => <KeysList key={index} {...item} />)*/}
              </MDBCol>
              <MDBCol md="5">
                  <div style={{borderBottom:"1px black"}}>
                    <p>a</p>
                    <p>a</p>
                    <p>a</p>
                  </div>

                  <div style={{borderBottom:"1px black"}}>
                    <p>b</p>
                    <p>b</p>
                    <p>b</p>
                  </div>
              </MDBCol>
            </MDBRow>
          </MDBContainer>

          </Modal.Body>
          <Modal.Footer>
            <Button id="btn-details-close" variant="dark" class="btn btn-dark" onClick={handleClose}>
              Schließen
            </Button>
        </Modal.Footer>
        </Modal>
      </>
    );
  }

const KeysList=(props)=>{
  console.log(props);
  console.log(props.place);
  const objectID=props.id;
  let childs = props.link;
  let len = 0
  if (childs!=undefined){
    len = childs.length
  }

  return (
  <div>
    <p>{props['title']}</p>
    <p>{props['place']}</p>
    <p>{props['facetObjectType']}</p>
    <p>{len}</p>
    <p name="details"><Display name="modalOpen" value={objectID}/></p>
  </div> 
  );
};

const RowDetails=(props)=>(
    <p>
    testen
    </p>
);
export default Display;
